function filteredArray(arr, elem) {
  let newArr = [];

  // Iterate through each sub-array in arr
  for (let i = 0; i < arr.length; i++) {
    // Check if the sub-array does not contain elem
    if (!arr[i].includes(elem)) {
      // Add the sub-array to newArr
      newArr.push(arr[i]);
    }
  }

  return newArr;
}

// Test cases
console.log(filteredArray([[3, 2, 3], [1, 6, 3], [3, 13, 26], [19, 3, 9]], 3)); 
// should return []

console.log(filteredArray([[10, 8, 3], [14, 6, 23], [3, 18, 6]], 18)); 
// should return [[10, 8, 3], [14, 6, 23]]

console.log(filteredArray([[1, 2, 3], [4, 5, 6], [7, 8, 9]], 5)); 
// should return [[1, 2, 3], [7, 8, 9]]

console.log(filteredArray([["apple", "banana"], ["cherry", "date"], ["banana", "date"]], "banana")); 
// should return [["cherry", "date"]]
